import { Injectable } from '@angular/core';
import { HttpClient } from '@angular/common/http';

export interface Noticias {
  '@attributes': {
    version: string;
  };
  'channel': {
    description: string;
    image: {
      link: string,
      title: string
    };
    item: object,
    language: string,
    lastBuildDate: string,
    link: string,
    title: object,
    ttl: string
    // outras propriedades
  };
  // outras propriedades
}

export interface Itens{
category: string,
description: object,
enclosure: object,
attributes: object,
guid: string,
link: string,
pubDate: string,
title: string
}



@Injectable({
  providedIn: 'root'
})
export class PuxarFeedService {
  private url = "http://127.0.0.1/teste_rss/"

  constructor(private http: HttpClient) { }

  GetAll(){
    return this.http.get(this.url + '?url=https://www.gazetadopovo.com.br/feed/rss/economia.xml')
  }
}
